import React from 'react';
import { NavLink } from 'react-router-dom';

function Header() {

  const activeStyle = {
    fontWeight: "bold",
    color: "red"
  };

  return (
    <header>
      <nav>
        <ul>
          <li>
            <NavLink to="/" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
              Домашня сторінка
            </NavLink>
          </li>
          <li>
            <NavLink to="/horizontal" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
              Горизонтальний світлофор
            </NavLink>
          </li>
          <li>
            <NavLink to="/vertical" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
              Вертикальний світлофор
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
